import React from 'react'
import gitHubImg from '../../public/images/github-24.png'

export default function Footer() {
    return (
        <div className="footer">
            <span><img className="github-logo" src={gitHubImg}></img></span>
            <span>Read More</span>
        </div>
    )
}
